import React from "react";
import classes from "./List.module.scss";

import {
  Container,
  Row,
  Col,
  Card,
  Form,
  Alert,
  Button,
} from "react-bootstrap";

interface TItem {
  id: string;
  text: string;
}

interface TProps {
  items: TItem[];
}

const List: React.FC<TProps> = (props) => {
  return (
    <div className={classes.List}>
      <Container className="pt-5">
        <Row>
          <Col>
            <Card>
              <Form>
                <Form.Group controlId="ItemText">
                  <Form.Control
                    type="input"
                    placeholder="Enter the item's text"
                  ></Form.Control>
                </Form.Group>
                <Button variant="primary" type="submit" block>
                  Submit
                </Button>
              </Form>
            </Card>

            {props.items.map((item) => {
              return (
                <Alert key={item.id} variant="success">
                  {item.text}
                </Alert>
              );
            })}
            {props.children}
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default List;
